import React from "react";
import { Link } from "react-router-dom";

const Navbar = () => {
  return (
    <nav className="bg-white shadow-md p-4 flex justify-between">
      <div className="text-xl font-bold">Language Trends</div>
      <div className="flex space-x-4">
        <Link to="/">Home</Link>
        <Link to="/language-prediction">Language Prediction</Link>
        <Link to="/language-trends">Language Trends</Link>
      </div>
    </nav>
  );
};

export default Navbar;
